description:
Todd asks Carly, &quot;Are you propositioning me?&quot; She replies, &quot;Yes I am.&quot;

Ellie tells Lulu, &quot;My wish is that Damien can cheer her up.&quot;

Spin tells Maxie, &quot;I never thought Matt was the right man for you.&quot; &quot;Then who is the right man Spinelli?&quot; she asks.

Luke spills a drink on Duke.

Brit asks Patrick, &quot;Are you going to come home with me?&quot;

Michael asks the grim reaper, &quot;Who are you?&quot;
